import React from 'react'
import Breadcrumbs from "@material-ui/core/Breadcrumbs";
import {Container, Grid, Link} from "@material-ui/core";
import PropTypes from 'prop-types';

import Home from './Components/Home';
import Skills from './Components/Skills';
import Project from './Components/Project';

import './App.css';
import {withStyles} from "@material-ui/styles";
import Paper from "@material-ui/core/Paper";

const styles = theme => ({
    root: {
        flexGrow: 1,
    },
    paper: {
        padding: theme.spacing(2),
        textAlign: 'center',
        color: theme.palette.text.secondary,
    },
});

class App extends React.Component {

    constructor(props, context) {
        super(props, context);
        this.state = {
            currentComponent: <Home/>,
            defaultColorPageLink: 'inherit',
            activeColorPageLink: 'initial',
        }

        this.changeCurrentComponent = this.changeCurrentComponent.bind(this);
    }

    changeCurrentComponent(event) {
        console.log(event);
        switch (event.target.innerText) {
            case 'Home':
                this.setState({currentComponent: <Home/>});

                break;

            case 'Skills':
                this.setState({currentComponent: <Skills/>});
                break;

            case 'Project':
                this.setState({currentComponent: <Project/>})
                break;

            default:
                this.setState({currentComponent: <Home/>});
                break;
        }
    }

    render() {
        const {classes} = this.props;

        return (
            <div className={classes.root}>
                <Grid container spacing={3}>
                    <Grid item xs={12}>
                        <Paper className={classes.paper}>xs=12</Paper>
                    </Grid>
                </Grid>
            </div>
        /*<Container maxWidth={false}>

                <Breadcrumbs aria-label={"breadcrumb"}>
                    <Link color={this.state.activeColorPageLink} onClick={this.changeCurrentComponent}>
                        Home
                    </Link>
                    <Link color={this.state.defaultColorPageLink} onClick={this.changeCurrentComponent}>
                        Skills
                    </Link>
                    <Link color={this.state.defaultColorPageLink} onClick={this.changeCurrentComponent}>
                        Project
                    </Link>
                </Breadcrumbs>
                {this.state.currentComponent}
            </Container>*/
        )
    }
}

App.prototypes = {
    classes: PropTypes.object.isRequired,
};

export default withStyles(styles)(App);
